  border: 1px solid #DDD;
  height: 350px;
  background-color: #54AF8D;
  ${mediaQuery.lessThan('medium')`
    border: 1px solid #DDD;
    height: 350px;
    background-color: #54AF8D;
  `}
`;


const layoutStyle = {
  //margin: 20,
  border: '1px solid #DDD',
  height: '350px',
  backgroundColor: '#54AF8D',
};

const PartnersLayout = props => (
  <div>
    <Contents>
      <Partners />
      {props.children}
      </Contents>
  </div>
);

export default PartnersLayout;
